import { View, StyleSheet,Text } from "react-native";

export function HomeScreen({ navigation }) {
    return (
      <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
        <Text style={styles.button} onPress={() => navigation.navigate('Adicionar Planta')}>Adicionar planta</Text>
        <Text style={styles.texto} onPress={() => navigation.navigate('Adicionar Planta')}>Minhas plantas</Text>
        <Text style={styles.texto} onPress={() => navigation.navigate('Adicionar Planta')}>Dicas</Text>
      </View>
    );
  }

  const styles = StyleSheet.create({
    texto: {
      backgroundColor:'green',
      fontSize:24,
  
    },
    button: {
      backgroundColor:'red',
      fontSize:24,
  
    },
  });
